  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115765 includes chemical,
  meteorological, physical and underway - surface data collected from CAPE HATTERAS
  in the Gulf of Mexico from 2009-01-09 to 2010-03-21. These data include BAROMETRIC
  PRESSURE, CARBON DIOXIDE - AIR, Partial pressure (or fugacity) of carbon dioxide,
  SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect these data
  include Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator for
  autonomous carbon dioxide (CO2) measurement.nnThese data were collected by Wei-Jun
  Cai of University of Delaware; College of Earth, Ocean, and Environment; School
  of Marine Science and Policy as part of the Coastal_Cape Hatteras_GM_0901, Coastal_Cape_Hatteras_GM_0904,
  Coastal_Cape_Hatteras_GM_0907 and Coastal_Cape_Hatteras_GM_1003 data set. CDIAC
  assigned the following cruise ID(s) to this data set: 32KZ20090109, 32KZ20090420,
  32KZ20090719 and 32KZ20100311.nnThe Global Coastal Carbon Data Project data includes
  the bottle (discrete) and surface (underway) carbon-related measurements from coastal
  research cruises, the data from time series cruises and coastal moorings. The coastal
  regions data are very important for the understanding of carbon cycle on the continental
  margins.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
